import React, { Component } from 'react';
import PropTypes from 'prop-types';
import Typography from '@material-ui/core/Typography';
import {connect} from 'react-redux';
import {getUser} from './../../reducers/user.reducer';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import PersonCard from './components/personCard';

function TabContainer(props) {
  return (
    <Typography component="div" style={{ padding: "24px" }}>
      {props.children}
    </Typography>
  );
}

TabContainer.propTypes = {
  children: PropTypes.node.isRequired,
};


class ExplorePeople extends Component {
  constructor(props) {
    super(props);
    this.state = {
      currentTab: 0,
      header: "For You",
    }
  }

  handleTabChange  (tabNum)  {
    if (tabNum === 0) {
      this.setState({ currentTab: 0 });
      this.setState({ header: "For You" });
    }
    else if (tabNum === 1) {
      this.setState({ currentTab: 1 });
      this.setState({ header: "New" });
    }
    else if (tabNum === 2) {
      this.setState({ currentTab: 2 });
      this.setState({ header: "Popular" });
    }
  };

  render() {
    return (
      <div className="ExplorePeople">
        <div className="PageTitle">
          <Typography id="overline">
          PEOPLE
          </Typography>
          <Typography variant="display4">
          {this.state.header}
          </Typography>
          <Tabs value={this.state.currentTab} indicatorColor="primary">
            <Tab label="For You" onClick={()=>this.handleTabChange(0)} />
            <Tab label="New" onClick={()=>this.handleTabChange(1)} />
            <Tab label="Popular" onClick={()=>this.handleTabChange(2)} />
          </Tabs>
        </div>
        <PersonCard/>
      </div>
    );
  }
}

const mapStateToProps =(state) =>{
  return{
    user: getUser(state)
  }
}
export default connect(mapStateToProps)(ExplorePeople);
